import React, { useState } from "react";
import {
  ScrollView,
  View,
  KeyboardAvoidingView,
  Platform,
  Text,
  Pressable,
  TextInput,
} from "react-native";
import { SvgXml } from "react-native-svg";
import Input from "../../components/Input";
import { icon, styles } from "./BusinessTitle";
import DateTimePickerModal from "react-native-modal-datetime-picker";
import {
  convertDate,
  serverTimeToLocal,
  serverTimeToLocalDate,
} from "../../action";
import IconButton from "../../components/IconButton";
import ViewMore from "../../Hooks/ViewMore";
import { useDispatch, useSelector } from "react-redux";
import { useIsFocused } from "@react-navigation/native";
import { setHideBottomBar } from "../../Reducers/hideBottomBar";

export default function Established({ navigation, route }) {
  const businessForm=useSelector(state=>state.businessForm)
  const dispatch=useDispatch()
  const [date, setDate] = useState(businessForm?.startDate?.day);
  const data = route?.params?.data;
  const [layoutHeight,setLayoutHeight]=useState(0)
  const isFocused=useIsFocused()
  React.useEffect(() => {
    if (isFocused) {
      //console.log("hidden")
      dispatch(setHideBottomBar(true));
      setTimeout(() => {
        dispatch(setHideBottomBar(true));
      }, 50);
    } else {
      //console.log("seen")
      dispatch(setHideBottomBar(false));
    }
  }, [isFocused]);

  return (
    <KeyboardAvoidingView
      style={{ flex: 1 }}
      behavior={Platform.OS === "ios" ? "padding" : null}
      keyboardVerticalOffset={Platform.OS === "ios" ? 80 : 0}>
      <ScrollView showsVerticalScrollIndicator={false}>
        <View
          style={{
            marginTop: 24,
            paddingHorizontal: 20,
          }}>
          <SvgXml width={"100%"} xml={vectorImage} />
          <View
            style={{
              flexDirection: "row",
              flex: 1,
              marginTop: 36,
            }}>
            <SvgXml
              style={{
                marginRight: 8,
              }}
              xml={icon}
            />
            <Text style={[styles.headLine, { flex: 1 }]}>
              Tips for set up the established/starting date
            </Text>
          </View>
          <ViewMore
            style={{
              marginTop: 24,
            }}
            width={145}
            height={layoutHeight}
            component={
              <Text onLayout={(e) => setLayoutHeight(e.nativeEvent.layout.height)} 
              style={[styles.spText,{marginTop:0}]}>
                Please provide the establishment date of your company.{" "}
                <Text style={{ fontWeight: "700" }}>
                  If you are an individual
                </Text>{" "}
                without a company, please enter the date you started working as
                a freelancer or the current date. Note that this field cannot be
                left blank, as it helps us connect you with the right buyers and
                sellers. Thanks for choosing our marketplace, and we look
                forward to helping you succeed!
              </Text>
            }
          />
          <Text style={[styles.headLine, { marginTop: 36 }]}>
            Established/starting date
          </Text>
          <CustomInput value={date} onChange={(e)=>{
            if(e>new Date()){
              setDate(new Date())
              return
            }
            setDate(e)
          }} />
          <IconButton
            active={date ? true : false}
            disabled={date ? false : true}
            onPress={() => {
              dispatch({
                type: "START_DATE",
                playload: {
                  day: date,
                  month: date,
                  year: date,
                },
              });
              navigation.navigate("WorkingTime",{
                data:{
                  serviceCenterName: data.serviceCenterName,
                  providerName: data.providerName,
                  gender: data.gender,
                  position: data.position,
                  numberOfTeam:data.numberOfTeam,
                  established:date,
                }
              });
            }}
            style={styles.button}
            title={"Continue"}
          />
        </View>
      </ScrollView>
    </KeyboardAvoidingView>
  );
}
const CustomInput = ({ value, onChange }) => {
  const [isDatePickerVisible, setDatePickerVisibility] = useState(false);

  const showDatePicker = () => {
    setDatePickerVisibility(true);
  };

  const hideDatePicker = () => {
    setDatePickerVisibility(false);
  };

  const handleConfirm = (date) => {
    if (onChange) {
      onChange(date);
    }
    hideDatePicker();
  };
  return (
    <Pressable
      onPress={showDatePicker}
      style={{
        flexDirection: "row",
        paddingHorizontal: 12,
        alignItems: "center",
        borderWidth: 1,
        borderColor: "#A3A3A3",
        height: 45,
        borderRadius: 4,
        marginTop: 24,
      }}>
      <SvgXml xml={dateIcon} />
      <Text
        style={{
          marginLeft: 10,
          fontSize: 14,
          color: "#767676",
        }}>
        {value ? serverTimeToLocalDate(value) : "dd/mm/yyyy"}
      </Text>
      <DateTimePickerModal
        isVisible={isDatePickerVisible}
        mode="date"
        onConfirm={handleConfirm}
        onCancel={hideDatePicker}
      />
    </Pressable>
  );
};
